              <Accordion>
        <AccordionSummary
          expandIcon={<ExpandMoreIcon />}
          aria-controls="panel1a-content"
          id="panel1a-header"
        >
          <Typography className={classes.heading}>Accordion 1</Typography>
        </AccordionSummary>
        <AccordionDetails>
        <div className={classes.liste}>
                <List >
                    <ListItem >
                    <Typography variant="subtitle1" gutterBottom>
                        Palier 3 : 10 minutes
                    </Typography>

                    </ListItem>
                    <Divider />
                    <ListItem >
                    <Typography variant="subtitle1" gutterBottom>
                        Palier 6 : 15 minutes
                    </Typography>

                    </ListItem>
                    <Divider />
                    <ListItem >
                    <Typography variant="subtitle1" gutterBottom>
                        Palier 9 : 20 minutes
                    </Typography>

                    </ListItem>
                    <Divider />
                    <ListItem >
                    <Typography variant="subtitle1" gutterBottom>
                        Palier 15 : 30 minutes
                    </Typography>

                    </ListItem>
                    <Divider />
                </List>

            </div>
        </AccordionDetails>
      </Accordion>
              </Grid>



              <Grid item xs={3}>
              <Accordion>
        <AccordionSummary
          expandIcon={<ExpandMoreIcon />}
          aria-controls="panel1a-content"
          id="panel1a-header"
        >
          <Typography className={classes.heading}>Accordion 1</Typography>
        </AccordionSummary>
        <AccordionDetails>
          <Typography>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse malesuada lacus ex,
            sit amet blandit leo lobortis eget.
          </Typography>
        </AccordionDetails>
      </Accordion>
              </Grid>
            </Grid>
          </Typography>
        </AccordionDetails>
      </Accordion>


    </div>
  );
}
export default SimpleAccordion;
